import React from 'react';
import styled from 'styled-components'

import { AppRouterLink } from '../../../UI/AppRouterLink'
import { AppPercentIcon } from '../../../UI/Icons/AppPercentIcon'


const RouterLinkText = styled.span`
  margin-top: 5px;
`

export const HeaderMainNav = () => {
  const navLinksData = [
    { name: 'Акции', href: '/stock' }
  ]

  return (
    <div className="container">
      <div className="row">
        <nav>
          { navLinksData.map((linkData, id) => (
            <AppRouterLink href={ linkData.href } key={ id } className="d-flex flex-column align-items-center">
              <AppPercentIcon />
              <RouterLinkText>{ linkData.name }</RouterLinkText>
            </AppRouterLink>
          )) }
        </nav>
      </div>
    </div>
  )
}
